export default () => {
	var canvas = document.createElement("canvas")
	var c = canvas.getContext("2d")
	const string = svg2String(svg)
	//新建Image对象
	var img = new Image()
	var url =
		"data:image/svg+xml;base64," +
		window.btoa(unescape(encodeURIComponent(string)))

	// img.src = `data:image/svg+xml;utf8,${encodeURIComponent(svgText)}`;
	//svg内容
	img.src = url //svg内容中可以有中文字符
	// console.log("svg2png img.onload", svg)
	//图片初始化完成后调用
	img.onload = function () {
		document.body.appendChild(img)

		//将canvas的宽高设置为图像的宽高
		canvas.width = 300
		canvas.height = (300 * img.height) / img.width

		//canvas画图片
		c.drawImage(img, 0, 0, 300, (300 * img.height) / img.width)

		//将图片添加到body中
		document.body.appendChild(img)

		var img2 = new Image()
		img2.src = "https://ik.imagekit.io/mrmiss/1597388217678_gf51AR9PWR.png"
		img2.onload = function () {
			c.drawImage(img2, 0, 0, 300, (300 * img.height) / img.width)
			document.body.appendChild(canvas)
		}
	}
}
